var codeArea = document.getElementById('code');
var inputArea = document.getElementById('input');
var outputArea = document.getElementById('output');
var inputSelect = document.getElementById('inputOptions');
var outputSelect = document.getElementById('outputOptions');
var fileSelect = document.getElementById('files');

function setElements()
{
    codeArea = document.getElementById('code');
    inputArea = document.getElementById('input');
    outputArea = document.getElementById('output');
    inputSelect = document.getElementById('inputOptions');
    outputSelect = document.getElementById('outputOptions');
    fileSelect = document.getElementById('files');
    outputArea.value = "";
}

function run()
{
    setElements();
    if(inputSelect.value == "Brainf" && outputSelect.value == "ConvertToBonk")
    {
        outputArea.value = brainfToBonk(codeArea.value);
    }
    else if(inputSelect.value == "Bonk" && outputSelect.value == "RunBonk")
    {
        outputArea.value = interpretBrainf(bonkToBrainf(codeArea.value),inputArea.value);
    }
    else
    {
        outputArea.value = "Something strange happened. :(";
    }
}

function runInNewWindow()
{
    setElements();
    if(inputSelect.value == "Brainf" && outputSelect.value == "ConvertToBonk")
    {
        var myWindow = window.open("","","width=600,height=450");
        myWindow.document.write("<textarea rows='30' cols='70' style='width: 100%; height: 100%;'>" + brainfToBonk(codeArea.value) + "</textarea>");
        outputArea.value = "Output in new window.";
    }
    else if(inputSelect.value == "Bonk" && outputSelect.value == "RunBonk")
    {
        var myWindow = window.open("","","width=600,height=450");
        myWindow.document.write("<textarea rows='30' cols='70' style='width: 100%; height: 100%;'>" + interpretBrainf(bonkToBrainf(codeArea.value),inputArea.value) + "</textarea>");
        outputArea.value = "Output in new window.";
    }
    else
    {
        var myWindow = window.open("","","width=600,height=450");
        myWindow.document.write("<textarea rows='30' cols='70' style='width: 100%; height: 100%;'>" + "Something strange happened. :(" + "</textarea>");
        outputArea.value = "Output in new window.";
    }
}

function brainfToBonk(code)
{
    var builder = "";
    for (var i = 0; i < code.length; i++) {
        if (code.charAt(i) == '>') {builder += ("BONK ");}
        else if (code.charAt(i) == '<') {builder += ("KNOB ");}
        else if (code.charAt(i) == '+') {builder += ("BONKBONK ");}
        else if (code.charAt(i) == '-') {builder += ("KNOBKNOB ");}
        else if (code.charAt(i) == '.') {builder += ("BONKED ");}
        else if (code.charAt(i) == ',') {builder += ("KNOBED ");}
        else if (code.charAt(i) == '[') {builder += ("BOINK ");}
        else if (code.charAt(i) == ']') {builder += ("KNIOB ");}
    }
    if(builder == "")
    {
        builder = "Something strange happened. :(";
    }
    return builder.toString();
}

function bonkToBrainf(code)
{
    var split = code.split(" ");
    var builder = "";
    for (var i = 0; i < split.length; i++) {
        if (split[i] == "BONK") {builder += (">");}
        else if (split[i] == "KNOB") {builder += ("<");}
        else if (split[i] == "BONKBONK") {builder += ("+");}
        else if (split[i] == "KNOBKNOB") {builder += ("-");}
        else if (split[i] == "BONKED") {builder += (".");}
        else if (split[i] == "KNOBED") {builder += (",");}
        else if (split[i] == "BOINK") {builder += ("[");}
        else if (split[i] == "KNIOB") {builder += ("]");}
    }
    if(builder == "")
    {
        builder = "Something strange happened. :(";
    }
    return builder.toString();
}

//Courtesy of Dave Cousineau @ https://stackoverflow.com/questions/45774767/brainfuck-interpreter-wrong-behaviour
function interpretBrainf(code, input) {
    // "Infinite" heap of memory initialized as 0 for bf to store program values
    let data = new Proxy([], {get: (arr, i) => arr[i] ? arr[i] : 0 })
    let ptr = 0;
    let inputPtr = 0;
    let codePtr = 0;
    let output = '';
    let loopStack = []
  
    const op = {
      '+' : () => {
        if (data[ptr] === 255) { data[ptr] = 0; }
        else { data[ptr]++; }
        codePtr++;
      },
      '-' : () => {
        if (data[ptr] === 0) { data[ptr] = 255; }
        else { data[ptr]--; }
        codePtr++;
      },
      '.' : () => { 
        output += String.fromCharCode(data[ptr]);
        codePtr++;
      },
      ',' : () => {
        data[ptr] = input.charCodeAt(inputPtr++); 
        codePtr++;
      },
      '>' : () => { 
        ptr++; codePtr++; 
      },
      '<' : () => {
        if (ptr > 0) { ptr--; }
        codePtr++; 
      },
      '[' : () => {
        if (data[ptr] === 0) {
          let level = 0;
          while(code[codePtr] !== ']' || level > 1) {
             if (code[codePtr] === '[')
                level += 1;
             if (code[codePtr] === ']')
                level -= 1;
             codePtr++;
          }
        } else { 
          loopStack.unshift(codePtr);
        }
        codePtr++ 
      },
      ']' : () => {
        if (data[ptr] === 0) { loopStack.shift(); }
        else { codePtr = loopStack[0] }
        codePtr++
      }
    }
  
    while(codePtr < code.length) {
      if(op[code[codePtr]]) op[code[codePtr]]()
      else codePtr++
    }
    if(output == "")
    {
        output = "Something strange happened. :(";
    }
    return output;
  }

